import{_ as p,c as t,j as o,a as r,G as s,a4 as i,B as e,o as c}from"./chunks/framework.iuAMY0aj.js";const g="/bullfrog/bullfrog-01.png",n="/bullfrog/bullfrog-02.png",d="/bullfrog/bullfrog-03.png",m="/bullfrog/bullfrog-04.png",u="/bullfrog/bullfrog-05.png",b="/bullfrog/bullfrog-06.png",f="/bullfrog/bullfrog-07.png",_="/bullfrog/bullfrog-08.png",h="/bullfrog/bullfrog-09.png",y="/bullfrog/bullfrog-10.png",k="/bullfrog/bullfrog-11.png",z="/bullfrog/bullfrog-12.png",P="/bullfrog/bullfrog-13.png",v="/bullfrog/bullfrog-14.png",q="/bullfrog/bullfrog-15.png",x="/bullfrog/bullfrog-16.png",D="/bullfrog/bullfrog-17.png",I="/bullfrog/bullfrog-18.png",w="/bullfrog/bullfrog-19.png",N="/bullfrog/bullfrog-20.png",V="/bullfrog/icon/icon-01.png",A="/bullfrog/icon/icon-02.jpg",B="/bullfrog/bullfrog-21.png",$="/bullfrog/bullfrog-22.png",j="/bullfrog/bullfrog-23.png",M="/bullfrog/bullfrog-24.png",S="/bullfrog/bullfrog-25.png",U="/bullfrog/bullfrog-26.png",H=JSON.parse('{"title":"牛蛙助手安装及使用","description":"","frontmatter":{"prev":false,"next":false},"headers":[],"relativePath":"yiov/iPhone/sign/bullfrog.md","filePath":"yiov/iPhone/sign/bullfrog.md","lastUpdated":1734678955000}'),C={name:"yiov/iPhone/sign/bullfrog.md"};function E(G,l,J,O,T,Y){const a=e("ArticleMetadata");return c(),t("div",null,[l[0]||(l[0]=o("h1",{id:"牛蛙助手安装及使用",tabindex:"-1"},[r("牛蛙助手安装及使用 "),o("a",{class:"header-anchor",href:"#牛蛙助手安装及使用","aria-label":'Permalink to "牛蛙助手安装及使用"'},"​")],-1)),s(a),l[1]||(l[1]=i('<div class="tip custom-block"><p class="custom-block-title">(当前界面文档全部来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>最早接触的签名工具是 <a href="https://www.i4.cn/" target="_blank" rel="noreferrer">爱思助手</a> ，但全程都需要电脑，很麻烦</p><p>牛蛙的诞生就完美解决了这个问题，仅需首次需要电脑</p><h2 id="安装" tabindex="-1">安装 <a class="header-anchor" href="#安装" aria-label="Permalink to &quot;安装&quot;">​</a></h2><p>牛蛙助手官网：<a href="https://www.ios222.com/" target="_blank" rel="noreferrer">https://www.ios222.com/</a></p><p><img src="'+g+'" alt="" loading="lazy"></p><p>下载打开，手机解锁屏幕，连接数据线安装</p><p><img src="'+n+'" alt="" loading="lazy"></p><p>直到提示安装完成</p><p><img src="'+d+'" alt="" loading="lazy"></p><p>打开手机桌面的牛蛙助手，获取UDID</p><p><img src="'+m+'" alt="" loading="lazy"></p><p>跳转到网页，下载描述文件</p><p><img src="'+u+'" alt="" loading="lazy"></p><p>设置 - 已下载描述文件，安装描述文件</p><details class="details custom-block"><summary>其他入口</summary><p>设置 -通用 - VPN与设备与管理 - 安装</p></details><p><img src="'+b+'" alt="" loading="lazy"></p><p>安装完成，跳转进入牛蛙主界面</p><p><img src="'+f+'" alt="" loading="lazy"></p><p>点击 <code>IPA签名</code> ，右下 <code>证书</code> - 右上+号 <code>个人证书</code></p><p><img src="'+_+'" alt="" loading="lazy"></p><p>输入你的 <code>Apple ID和密码</code> ，认证成功即可生成个人证书</p><details class="details custom-block"><summary>登录失败报错</summary><p>1.确保密码正确，再次尝试登录</p><p>2.一般首次会被锁定，强制要求改密码，在设置中退出账号后重新登录，修改完 Apple ID 密码后再次尝试，或者半小时后再试</p></details><p><img src="'+h+'" alt="" loading="lazy"></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>个人证书有效期7天，企业证书要花钱买！</p></div><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><h3 id="虚拟定位" tabindex="-1">虚拟定位 <a class="header-anchor" href="#虚拟定位" aria-label="Permalink to &quot;虚拟定位&quot;">​</a></h3><p>点击虚拟定位，默认用蓝奏的镜像，这里提示<code>镜像挂载失败</code></p><p><img src="'+y+'" alt="" loading="lazy"></p><p>设置-通用-VPN与设备与管理-VPN，选择牛蛙助手，开关打开</p><p>再次回到APP，已经可以用了，权限给<code>使用App时允许</code></p><p><img src="'+k+'" alt="" loading="lazy"></p><p>先搜索一个自己要定位的地名，比如：东方明珠，点一下这个标记，然后点锁定即可</p><p><img src="'+z+'" alt="" loading="lazy"></p><p>锁定成功，打开微信定位就可以看到，已经成功了</p><p><img src="'+P+'" alt="" loading="lazy"></p><p>不使用了一定要解锁，否则就回不来了！！！</p><p><img src="'+v+'" alt="" loading="lazy"></p><h3 id="签名及多开" tabindex="-1">签名及多开 <a class="header-anchor" href="#签名及多开" aria-label="Permalink to &quot;签名及多开&quot;">​</a></h3><p>以 <code>微信</code> 签名及多开为例</p><p>点击下载 <a href="https://github.com/Yiov/wechat-dump/releases/tag/dump" target="_blank" rel="noreferrer">砸好壳的微信ipa包</a>，演示的版本是 <code>8.0.44</code></p><div class="tip custom-block"><p class="custom-block-title">科普</p><p>这里的dump就表示砸壳，就是提取ipa安装包</p><p>因为苹果对安装包进行了加密，并包裹在了ipa上，砸壳的过程就是解密脱壳</p></div><p><img src="'+q+'" alt="" loading="lazy"></p><p>下载 - 点击下载好的文件</p><p><img src="'+x+'" alt="" loading="lazy"></p><p>右上角分享 - 用 <code>牛蛙助手</code> 打开</p><p><img src="'+D+'" alt="" loading="lazy"></p><p>发送，导入应用库</p><p><img src="'+I+'" alt="" loading="lazy"></p><p>点微信 - 签名</p><p><img src="'+w+'" alt="" loading="lazy"></p><p>这里我们多开就修改下 <code>应用名称</code> 和 <code>Bundle Identifier</code> 就好了，例如我在后面都加了个 <code>pro</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>Bundle ID就是应用程序标识符，也叫应用ID，也叫包名，独一无二就相当于人的身份证</p><p>我们通过修改应用ID，就变成了两个完全独立的App，可共存安装，也就是多开</p></div><p><img src="'+N+'" alt="" loading="lazy"></p><p>根据自己需求也可以改一下图标，立即签名，签名成功，去安装</p><details class="details custom-block"><summary>分享2个图片</summary><p><img src="'+V+'" alt="" loading="lazy"></p><p><img src="'+A+'" alt="" loading="lazy"></p></details><p><img src="'+B+'" alt="" loading="lazy"></p><p>设置 - VPN - 勾选 <code>牛蛙助手</code> - 打开VPN开关</p><p><img src="'+$+'" alt="" loading="lazy"></p><p>再去安装，安装好后返回桌面查看</p><p><img src="'+j+'" alt="" loading="lazy"></p><p>现在还打不开，要信任一下</p><p><img src="'+M+'" alt="" loading="lazy"></p><p><img src="'+S+'" alt="" loading="lazy"></p><p>这样就能打开登录了</p><p><img src="'+U+'" alt="" loading="lazy"></p><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><details class="details custom-block"><summary>疑问1：为什么应用名称改了没用</summary><p>牛蛙每次签名自动默认原名称，并改掉应用ID</p><p>而应用ID还是按我们修改的来了</p></details><details class="details custom-block"><summary>疑问2：会封号吗</summary><p>理论上来说，99.99%不会</p><p>本身就是原版未修改的ipa包，不存在封号一说</p><p>有插件的都未必封号，最多限制几小时登陆；修改过的微商版微信那肯定是会封</p></details><details class="details custom-block"><summary>疑问3：怎么卸载</summary><p>卸载不能在桌面删，只能在 <code>已安装</code> 页卡，选中应用左滑即可卸载</p></details><details class="details custom-block"><summary>疑问4：再安装新版本微信聊天记录还在吗</summary><p>只要签名的时候，应用ID和上次一样就可以直接覆盖安装，聊天记录都在</p></details>',72))])}const K=p(C,[["render",E]]);export{H as __pageData,K as default};
